INSERT INTO `disease_answer` VALUES (3,'2023-03-22 16:05:56.471000','2023-03-22 16:05:56.471065','<p>Alo, saya dr. Tirtawati Wijaya. Terima kasih sudah bertanya ke Alodokter.</p>\r\n\r\n<p>Kontraksi yang dialami ibu hamil di penghujung kehamilan adalah pengerutan seluruh rahim untuk mendorong bayi keluar melalui jalan lahir. Ciri-ciri kontraksi menjelang kelahiran antara lain:</p>\r\n\r\n<ul>\r\n	<li>Seluruh bagian rahim terasa keras dan kencang, dapat juga menjalar ke seluruh tubuh ibu, seperti ke punggung, perut, dst.</li>\r\n	<li>Intensitas kontraksi makin lama makin kuat, frekuensinya makin lama makin tinggi, durasinya makin lama makin panjang.</li>\r\n	<li>Disertai dengan nyeri perut bagian bawah (jalan lahir) di mana mulai terjadi pembukaan.</li>\r\n	<li>Keluar lendir campur darah dari jalan lahir (the show)</li>\r\n	<li>Kadang disertai rembesan atau pecahnya air ketuban.</li>\r\n</ul>\r\n\r\n<p>Ibu yang baru pertama kali hamil mungkin belum dapat membedakan antara kontraksi dengan gerakan janin. Namun secara garis besar gerakan janin memiliki ciri berikut:</p>\r\n\r\n<ul>\r\n	<li>Hanya bagian tertentu dari rahim yang mengeras, sementara bagian lainnya tetap lunak.</li>\r\n	<li>Sering terlihat bagian tertentu kandungan yang menonjol seperti didorong / ditendang dari dalam. Pada kontraksi, yang terjadi adalah pengerutan seluruh bagian rahim, jadi boleh dibilang tidak ada penonjolan titik tertentu.</li>\r\n	<li>Nyeri tidak mengalami peningkatan intensitas, frekuensi, maupun durasi. Nyeri karena gerakan bayi umumnya tergantung besarnya gerakan, dan hanya terasa bila terjadi gerakan bayi. Beda dengan kontraksi yang akan makin kuat, makin sering, dan makin lama secara progresif.</li>\r\n</ul>\r\n\r\n<p>Yang mungkin lebih sulit dibedakan oleh ibu yang baru pertama kali mengandung adalah Braxton Hicks contraction, atau yang dikenal sebagai kontraksi palsu. Kontraksi ini tidak disebabkan gerakan janin, sementara ciri-cirinya adalah:</p>\r\n\r\n<ul>\r\n	<li>Kandungan terasa kencang dan keras namun umumnya tidak disertai nyeri</li>\r\n	<li>Bila terasa nyeri pada mereka yang memiliki pain treshold rendah, umumnya rasa nyeri terpusat di bagian perut saja, tidak menjalar ke bagian lain.</li>\r\n	<li>Kontraksinya tidak mengalami peningkatan intensitas, frekuensi, ataupun durasi. Kontraksi Braxton Hicks umumnya disebabkan ibu yang kekurangan cairan atau kekurangan istirahat; tidak disebabkan oleh gerakan janin dan juga bukan kontraksi alamiah di akhir kehamilan.</li>\r\n	<li>Tidak terjadi pembukaan jalan lahir, the show, ketuban rembes atau pecah.</li>\r\n</ul>\r\n\r\n<p>Berikut ini adalah beberapa hal yang perlu bunda perhatikan di trimester terakhir:</p>\r\n\r\n<ul>\r\n	<li>Kontrol kehamilan secara rutin sesuai jadwal dan ikuti saran dokter. Memasuki minggu ke 38 umumnya bunda akan diminta lebih sering kontrol menjadi seminggu sekali. Bila kehamilan sampai memasuki minggu ke 40 (dihitung dari HPHT) bunda akan diminta kontrol setiap hari atau malah dianjurkan rawat inap di fasilitas kesehatan.</li>\r\n	<li>Lakukan hitung gerak janin setiap hari. Segera periksakan kehamilan bila janin tiba-tiba berkurang gerakannya, tidak selincah biasanya. Ini tujuannya agar dapat segera diberikan bantuan bila ternyata bayi mengalami gangguan kesehatan dalam kandungan.</li>\r\n	<li>Persiapkan baju bayi dan ibu yang akan digunakan setelah melahirkan setidaknya 3 setel, pakaian dalam, popok bayi baru lahir secukupnya, kaus kaki, selimut, sikat gigi, sabun, odol, dll; masukkan kesemuanya ke dalam tas dan ditempatkan di lokasi yang mudah dilihat. Siapkan juga semua dokumen yang akan dibutuhkan dalam proses pendaftaran di RS, persalinan, pendaftaran bayi di catatan sipil, BPJS, dll ke dalam tas tersebut. Ini agar semua keperluan tidak ada yang tertinggal / terlupa saat ibu siap bersalin sewaktu-waktu.</li>\r\n	<li>Ibu mengonsumsi makanan sehat seimbang bervariasi dalam jumlah cukup, untuk memenuhi kebutuhan nutrisi dan energi pada akhir kehamilan, proses bersalin, serta persiapan menyusui bayi.</li>\r\n	<li>Minum cukup air putih, hindari alkohol, kafein, teh, dll.</li>\r\n	<li>Jauhi asap rokok, hindari narkoba.</li>\r\n	<li>Berolahraga intensitas sedang selama 150 menit seminggu. Pilih olah raga yang low impact guna menurunkan risiko trauma. Contoh olahraga yang baik untuk ibu hamil antara lain senam hamil, berenang, jalan kaki, dll.</li>\r\n	<li>Cukup beristirahat. Upayakan tidur 7 - 9 jam semalam. Berbaringlah bila terasa lelah, gantilah posisi secara berkala agar beban berat kandungan tidak hanya tertumpu di satu titik saja.</li>\r\n	<li>Latihan pernafasan untuk persiapan bersalin. Sebaiknya latihan ini dilakukan bersama dengan orang yang akan mendampingi persalinan (misalnya suami) agar dapat saling membantu dan mengingatkan.</li>\r\n	<li>Segera ke fasilitas tempat bersalin bila Anda mengalami demam, nyeri perut bagian bawah, mengeluarkan darah / lendir / cairan ketuban dari jalan lahir, kejang, dll.</li>\r\n</ul>\r\n\r\n<p>Demikianlah penjelasan saya, semoga bermanfaat. Info tambahan dapat Anda baca dihttps://www.alodokter.com/bumil-kontraksi-ternyata-ada-beberapa-jenis-yuk-kenali</p>',1,33);
