INSERT INTO `disease_article` VALUES (2,'2023-02-25 14:02:02.645224','2023-03-22 15:09:06.340749','PENERAPAN ALGORITMA K-MEANS CLUSTERING UNTUK','penerapan-algoritma-k-means-clustering-untuk','<h1><strong>PENERAPAN ALGORITMA K-MEANS CLUSTERING UNTUK PENERAPAN ALGORITMA K-MEANS CLUSTERING UNTUK</strong></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tuberculosis (TBC) merupakan penyakit menular yang masih menjadi perhatian dunia. Hingga saat ini, belum ada satu negara pun yang bebas TBC. Angka kematian dan kesakitan akibat kuman mycobacterium tuberculosis ini pun tinggi. Tingkat prevalensi penderita TBC di Indonesia diperkirakan sebesar 289 per 100 ribu penduduk dan insidensi sebesar 189 per 100 ribu penduduk. Bahkan 27 dari 1.000 penduduk terancam meninggal seperti yang dilaporkan Direktorat Jendral Pengendalian Penyakit dan Penyehatan Lingkungan, Kementrian Kesehatan Republik Indonesia yang dihimpun sepanjang 2011 mengenai tuberkulosis (TBC) di Indonesia. Pengelompokkan wilayah penyebaran TBC penulis menggunakan algoritma KMeansClustering, algoritma K-MeansClustering mampu mengelompokkan data pada kelompok yang sama dan data yang berbeda pada kelempok yang berbeda. Sehingga akan terlihat titiktitik lokasi penyebaran penyakit diare. Algoritma K-Means Clustering selain mampu mengelompokkan data pada kelompok yang sama dan data yang berbeda pada kelompok berbeda, juga mampu menentukan titik pusat penyebaran. Diharapkan hasil penelitian ini mampu memberikan kontribusi dalam mengatasi penyebaran diare, dengan melihat pusat penyebaran maka akan membantu memfokuskan penanganan diare pada wilayah tersebut</p>','123','123123','12','tes','test','asdf','testt','Nerandra','https://jurnal.kaputama.ac.id/index.php/JTIK/article/view/41',27,1,'Aproved','thumbnail/default-thumbnail.png'),(3,'2023-02-25 14:32:45.751087','2023-03-22 15:09:06.343551','asdlfkd','asdlfkd','<p>kajsdkfjadsf</p>','lkajsdf','laksdjf','lkajsdfj','lkjasldfj','lkajsdflk','lkajsd','kljasd','lkajdf','h