  `thumbnail` varchar(100) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `slug` (`slug`),
  KEY `disease_book_created_by_id_809c5e9a_fk_users_useraccount_id` (`created_by_id`),
