INSERT INTO `disease_book` VALUES (1,'2023-02-08 04:37:33.124719','2023-03-22 15:08:45.296597','Mengenal Malaria Asimtomatik di Indonesia','mengenal-malaria-asimtomatik-di-indonesia','2012-01-01','200','Falcon Publishing','1','Nerandra','test','https://www.google.co.id/books/edition/Mengenal_Malaria_Asimtomatik_di_Indonesi/K_tgEAAAQBAJ?hl=id','test','<p>Malaria merupakan penyakit dengan penyebaran yang sangat luas di dunia dan menjadi endemis terutama di daerah tropis dan subtropis. Pada tahun 2013 masih terdapat 104 negara yang endemis malaria di dunia.&nbsp;</p>\r\n\r\n<p><br />\r\nSebanyak 3,4 milyar penduduk dunia beresiko terinfeksi malaria. Pada tahun 2012 terdapat 207 juta kasus malaria 627.000 meninggal dunia, 80 persen kasus berada di afrika, 90 persen kematian berada di afrika dan 77 persen angka kematian pada penderita yang berusia di bawah 5 tahun</p>\r\n\r\n<p>(WHO, 2013). Pada tahun 2012 terdapat 31 kabupaten/kota di Jawa Timur yang menginformasikan kasus malaria. Malaria import terbanyak di wilayah Provinsi Jawa Timur adalah di Kabupaten Trenggalek yakni sebesar 310 kasus. Malaria import di Jawa Timur sebesar 93,8% atau 1.320 orang dengan kasus indigenous sebanyak 9 orang atau 6,2% (Dinas Kesehatan Provinsi Jatim, 2013).</p>\r\n\r\n<p><br />\r\nPenilaian situasi malaria di suatu daerah dapat ditentukan melalui kegiatan surveilans epidemiologi. Salah satu parameter untuk pengamatan rutin malaria adalah menggunakan annual parasite insidence (API) (Gunawan, 2000). Pada tahun 2012 angka API malaria Jawa Timur mencapai 0,12 per 1.000 penduduk beresiko. Angka ini lebih rendah dibandingkan API tahun 2011 yakni 0,24 per1.000 penduduk beresiko (Dinas Kesehatan Provinsi Jatim,2013).</p>\r\n\r\n<p><br />\r\nGejala klinis utama dapat menjadi dasar penegakandiagnosis malaria yakni demam mengigil periodis, cefalgia, malaise, anemia, anoreksia, dyspepsia, vomiting disertaip embesaran limpa. Bila derajat penyakit berubah menjadim alaria berat maka akan timbul gejala di atas disertai kejang. Gejala klinis pada anak-anak makin tidak jelas gejala klinis tetapi yang menonjol adalah diare dan anemia serta adanya riwayat kunjungan ke atau berasal dari daerah malaria (McDonald, 2001; Kwena, 2003).</p>\r\n\r\n<p><br />\r\nAnemia merupakan manifestasi klinis yang paling sering dijumpai dan berperan penting pada morbiditas dan mortalitas malaria. Anemia sering terjadi pada penderita malaria berat (Philip, 1992). Anemia berhubungan dengan hemoglobin (Hb) (Philip, 1992). Anemia didefinisikan sebagai penurunan jumlah massa eritrosit yang mengakibatkan kadar hemoglobin menurun sehingga jumlah oksigen yang dibawa tidak cukup di jaringan perifer.</p>\r\n\r\n<p><br />\r\nAnemia pada malaria disebabkan oleh gangguan pembentukan eritrosit di sumsum tulang dan penghancuran eritrosit (Haldar, 2009).</p>\r\n\r\n<p><br />\r\nStudi mengenai anemia malaria sedikit terlambat menarik perhatian para akademisi dan professional. Anemia malaria berat sangat pantas dijadikan sebagai masalah kesehatan masyarakat utama karena banyaknya jumlah orang yang mengalaminya, dan nampaknya jumlah ini menjadi semakin meningkat seiring terjadinya resistensiobat antimalaria. Perhatian terhadap hal ini juga telah didukung oleh data dari penelitian terbaru mengenai vaksin, yang menyatakan bahwa kera yang diimunisasi dengan antigen tahap eritrosit, dan yang telah mendapatkan perlindungan dari infeksi akut, dapat menderita anemia berat selama fase infeksi sub-akut atau kronis (Egan, 2002; Jones, 2002). Lagipula, terjadi peningkatan kesadaran mengenai sulitnya pengobatan yang memuaskan melalui transfusi darah di luar pusat-pusat ahli pada kebanyakan daerah endemis sebagai akibat dari terbatasnya suplai darah yang cepat dan aman (Rowe, 2000; Fleming, 1997).</p>\r\n\r\n<p><br />\r\nOleh karena itu penulis mencoba untuk menulis buku ini sebagai bahan bacaan dan bahan rujukan untuk mengembangkan penelitian lebih lanjut mengenai Malaria Asimtomatik di Indonesia</p>\r\n\r\n<p>&nbsp;</p>',34,NULL,'Aproved','thumbnail/default-thumbnail.png'),(2,'2023-02-24 14:11:38.111440','2023-03-22 15:08:45.305219','testing','testing','2012-01-01','200','Falcon Publishing','1','test','test','https://www.shutterstock.com/g/M+Hadi+Sasmito?rid=183181748','test','<p>Testing</p>',2,1,'Aproved','thumbnail/default-thumbnail.png'),(3,'2023-02-25 13:15:21.350382','2023-03-22 15:08:45.311793','test','test','2023-02-10','200','asdf','asd','est','test','https://www.shutterstock.com/g/M+Hadi+Sasmito?rid=183181748','test','<p>tesete</p>',2,1,'Aproved','thumbnail/default-thumbnail.png'),(5,'2023-02-25 13:19:18.712213','2023-03-22 15:08:45.319320','tesaet','tesaet','2023-02-24','test','asdf','asd','aset','test','https://www.shutterstock.com/g/M+Hadi+Sasmito?rid=183181748','asdf','<p>tesetijiasjdf</p>',0,1,'Aproved','thumbnail/default-thumbnail.png'),(7,'2023-03-11 08:43:24.173087','2023-03-22 15:08:45.327077','test ting new volume after migration','test-ting-new-volume-after-migration','2023-03-11','200','asdf','asd','aset','Test','https://www.shutterstock.com/g/M+Hadi+Sasmito?rid=183181748','test','<p>content buku</p>',0,17,'Aproved','thumbnail/default-thumbnail.png'),(8,'2023-03-11 09:06:26.188821','2023-03-22 15:08:45.332865','lorenaa merana','lorenaa-merana','2023-03-11','loren','lorena','lorena','keselyoleren spd','loren','https://jurnal.kaputama.ac.id/index.php/JTIK/article/view/41','test','<p>lorean</p>',0,17,'Aproved','thumbnail/default-thumbnail.png');
