INSERT INTO `disease_disease` VALUES (2,'2023-01-29 02:58:46.720200','2023-03-23 14:44:27.191325','Hypertension Control Challenge','Test','Test','test','test','test','test','<h2>Call for Applications: 2023 Million Hearts&reg;&nbsp;Hypertension Control Challenge!</h2>\r\n\r\n<p><img alt=\"2023 Million Hearts Hypertension Control Challenge\" src=\"https://millionhearts.hhs.gov/images/2023-HTN-Challenge.png?_=13634\" title=\"2023-HTN-Challenge\" /></p>\r\n\r\n<p>Many health care professionals work with their patients to achieve blood pressure control. The 2023 Million Hearts&reg;&nbsp;Hypertension Control Challenge will identify medical practices in the United States and its territories that have demonstrated exceptional rates of patient hypertension control.</p>\r\n\r\n<p>Health professionals and practices that have achieved patient hypertension control rates of at least&nbsp;<strong>80%</strong>&nbsp;are eligible to enter the 2023 Million Hearts&reg;&nbsp;Hypertension Control Challenge for possible recognition as a Champion.&nbsp;<strong>The submission deadline is April 14, 2023.</strong></p>\r\n\r\n<p><a href=\"https://millionhearts.hhs.gov/partners-progress/champions/rules.html\">Learn more about the Challenge rules and eligibility</a></p>\r\n\r\n<p><a href=\"https://hypertension.millionhearts.hhs.gov/\">Application form</a></p>\r\n\r\n<h2>About the Challenge</h2>\r\n\r\n<p>The Million Hearts&reg;&nbsp;Hypertension Control Challenge identifies clinicians and practices that have demonstrated exceptional achievements in working with their patients to control hypertension. This year, we will be recognizing those who achieved blood pressure control (blood pressure readings below 140 mm Hg/90 mm Hg) among 80% of their hypertensive population ages 18&ndash;85 years.</p>\r\n\r\n<p>The Challenge is open to clinicians and medical practices located in the United States and its territories. Strategies used by Champions that support hypertension control may be written into a success story and posted on this website.</p>\r\n\r\n<p>As of 2022, CDC has recognized 143 Hypertension Control Champions across 42 states and the District of Columbia.</p>',29,'hypertension-control-challenge',1,'Aproved','thumbnail/default-thumbnail.png'),(3,'2023-03-10 23:31:52.142156','2023-03-19 13:39:25.993186','About Stroke','Test','Test','Test','Test','Test','test','<h1>About Stroke</h1>\r\n\r\n<p><a href=\"https://www.cdc.gov/stroke/about_esp.htm\">Espa&ntilde;ol (Spanish)</a>&nbsp;|&nbsp;<a href=\"https://www.cdc.gov/stroke/about.htm#print\" onclick=\"window.print()\">Print</a></p>\r\n\r\n<p><a href=\"https://www.cdc.gov/stroke/about.htm#\"><img alt=\"A stroke happens in one of two ways: a blocked artery or a ruptured artery.\" src=\"https://www.cdc.gov/stroke/images/Stroke-Medical-Illustration.jpg?_=77303\" title=\"Stroke-Medical-Illustration\" /></a></p>\r\n\r\n<p>A stroke, sometimes call a brain attack, happens in one of two ways: A blocked artery or a ruptured artery.</p>\r\n\r\n<p><a href=\"https://www.cdc.gov/stroke/about.htm#\">View Larger</a></p>\r\n\r\n<p>A stroke, sometimes called a brain attack, occurs when something blocks blood supply to part of the brain or when a blood vessel in the brain bursts.</p>\r\n\r\n<p>In either case, parts of the brain become damaged or die. A stroke can cause lasting brain damage, long-term disability, or even death.</p>\r\n\r\n<p>Learn about the health conditions and lifestyle habits&nbsp;that can increase your risk for stroke.</p>\r\n\r\n<h2>What happens in the brain during a stroke?</h2>\r\n\r\n<p>The brain controls our movements, stores our memories, and is the source of our thoughts, emotions, and language. The brain also controls many functions of the body, like breathing and digestion.</p>\r\n\r\n<p>To work properly, your brain needs oxygen. Your arteries deliver oxygen-rich blood to all parts of your brain. If something happens to block the flow of blood, brain cells start to die&nbsp;<strong>within minutes,</strong>&nbsp;because they can&rsquo;t get oxygen. This causes a stroke.</p>\r\n\r\n<p>Learn more about the&nbsp;<a href=\"https://www.cdc.gov/stroke/signs_symptoms.htm\">signs and symptoms</a>&nbsp;of stroke.</p>\r\n\r\n<h2>Quick treatment is critical for stroke</h2>\r\n\r\n<p>A stroke is a serious medical condition that requires&nbsp;<a href=\"https://www.cdc.gov/stroke/treatments.htm\">emergency care</a>. Act&nbsp;<a href=\"https://www.stroke.org/en/about-stroke/stroke-symptoms\">F.A.S.T</a>. Call 9-1-1 right away if you or someone you are with shows any signs of a stroke.</p>\r\n\r\n<p><strong>T</strong><strong>ime lost is brain lost. Every minute counts<em>.</em></strong></p>\r\n\r\n<h2>What are the types of stroke?</h2>\r\n\r\n<p>There are two types of stroke:</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://www.cdc.gov/stroke/about.htm#Ischemic\">Ischemic stroke</a>.</li>\r\n	<li><a href=\"https://www.cdc.gov/stroke/about.htm#Hemorrhagic\">Hemorrhagic stroke</a>.</li>\r\n</ul>\r\n\r\n<p>A&nbsp;<a href=\"https://www.cdc.gov/stroke/about.htm#transient\">transient ischemic attack (TIA)</a>&nbsp;is sometimes called a &ldquo;mini-stroke.&rdquo; It is different from the major types of stroke, because blood flow to the brain is blocked for only a short time&mdash;usually no more than 5 minutes.1</p>\r\n\r\n<h3>Ischemic stroke</h3>\r\n\r\n<p>Most strokes are ischemic strokes.2&nbsp;An ischemic stroke occurs when blood clots or other particles block the blood vessels to the brain.</p>\r\n\r\n<p>Fatty deposits called plaque can also cause blockages by building up in the blood vessels.</p>\r\n\r\n<h3>Hemorrhagic stroke</h3>\r\n\r\n<p>A hemorrhagic stroke happens when an artery in the brain leaks blood or ruptures (breaks open). The leaked blood puts too much pressure on brain cells, which damages them.</p>\r\n\r\n<p><a href=\"https://www.cdc.gov/bloodpressure/index.htm\">High blood pressure</a>&nbsp;and aneurysms&mdash;balloon-like bulges in an artery that can stretch and burst&mdash;are examples of conditions that can cause a hemorrhagic stroke.</p>\r\n\r\n<h3>Transient ischemic attack (TIA or &ldquo;mini-stroke&rdquo;)</h3>\r\n\r\n<p><img alt=\"Blanche Teal-Cruise\" src=\"https://www.cdc.gov/stroke/images/Blanche-medium.jpg?_=54266\" title=\"Blanche.jpg\" /></p>\r\n\r\n<p>For Blanche Teal-Cruise, a smoker for 40 years who also had high blood pressure, the transient ischemic attack (sometimes called a mini-stroke) she had on the way to work was a wake-up call.&nbsp;<a href=\"https://www.cdc.gov/stroke/survivor_stories/blanche.htm\">Read Blanche&rsquo;s story</a>.</p>\r\n\r\n<p>TIAs are sometimes known as &ldquo;warning strokes.&rdquo; It is important to know that</p>\r\n\r\n<ul>\r\n	<li>A TIA is a warning sign of a future stroke.</li>\r\n	<li>A TIA is a medical emergency, just like a major stroke.</li>\r\n	<li>Strokes and TIAs require emergency care.&nbsp;<strong>Call 9-1-1</strong>&nbsp;right away if you feel signs of a stroke or see symptoms in someone around you.</li>\r\n	<li>There is no way to know in the beginning whether symptoms are from a TIA or from a major type of stroke.</li>\r\n	<li>Like ischemic strokes, blood clots often cause TIAs.</li>\r\n	<li>More than a third of people who have a TIA and don&rsquo;t get treatment have a major stroke within 1 year. As many as 10% to 15% of people will have a major stroke within 3 months of a TIA.1</li>\r\n</ul>\r\n\r\n<p>Recognizing and treating TIAs can lower the risk of a major stroke. If you have a TIA, your health care team can find the cause and take steps to prevent a major stroke.</p>\r\n\r\n<h2>More information</h2>\r\n\r\n<h3>CDC</h3>\r\n\r\n<ul>\r\n	<li><a href=\"https://www.cdc.gov/bloodpressure/\">High Blood Pressure</a></li>\r\n	<li><a href=\"https://www.cdc.gov/heartdisease/\">Heart Disease</a></li>\r\n	<li><a href=\"https://www.cdc.gov/salt/\">Salt</a></li>\r\n	<li><a href=\"https://www.cdc.gov/cholesterol/\">Cholesterol</a></li>\r\n</ul>\r\n\r\n<h3>Million Hearts&reg;&nbsp;and CDC Foundation</h3>\r\n\r\n<ul>\r\n	<li>&ldquo;<a href=\"https://hearthealthysteps.org/\">Start Small. Live Big.&rdquo;</a>&nbsp;This campaign encourages adults 55 and older, to get back on track with the small steps&mdash;like scheduling their medical appointments, getting active, and eating healthy&mdash;so they can get back to living big.</li>\r\n	<li><a href=\"https://www.livetothebeat.org/\">&ldquo;Live to the Beat.&rdquo;</a>&nbsp;This campaign focuses on empowering Black adults to pursue heart-healthy lifestyles on their own terms&mdash;to find what works best individually and consistently&mdash; as they live to their own beat.</li>\r\n</ul>\r\n\r\n<h3>Other organizations</h3>\r\n\r\n<ul>\r\n	<li>American Stroke Association (ASA):&nbsp;<a href=\"https://www.stroke.org/en/about-stroke\">About Stroke</a></li>\r\n	<li>ASA Resources in Spanish:&nbsp;<a href=\"https://www.stroke.org/en/about-stroke/recursos-en-espanol\">Recursos en Espa&ntilde;ol</a></li>\r\n	<li>National, Heart, Lung, and Blood Institute:&nbsp;<a href=\"https://www.nhlbi.nih.gov/health-topics/stroke\">Stroke</a></li>\r\n	<li>National Institute of Neurological Disorders and Stroke (NINDS):&nbsp;<a href=\"https://www.ninds.nih.gov/Disorders/All-Disorders/Stroke-Information-Page\">Stroke Information Page</a>\r\n	<ul>\r\n		<li><a href=\"https://www.stroke.nih.gov/resources/\">NINDS Know Stroke Campaign</a></li>\r\n		<li><a href=\"https://www.stroke.nih.gov/materials/spanish-stroke-toolkit.htm\">NINDS Know Stroke Campaign Spanish Toolkit</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>',16,'about-stroke',1,'Aproved','thumbnail/default-thumbnail.png'),(4,'2023-03-10 23:32:45.379799','2023-03-24 04:05:54.870804','Stroke Signs and Symptoms','teset','test','test','test','test','test','<p>Learn what to do if you or someone else is having a stroke.</p>\r\n\r\n<p><a href=\"https://www.cdc.gov/stroke/signs_symptoms_esp.htm\">Espa&ntilde;ol (Spanish)</a>&nbsp;|&nbsp;<a href=\"https://www.cdc.gov/stroke/signs_symptoms.htm#print\" onclick=\"window.print()\">Print</a></p>\r\n\r\n<p>During a stroke, every minute counts!&nbsp;<a href=\"https://www.cdc.gov/stroke/treatments.htm\">Fast treatment</a>&nbsp;can lessen the brain damage that stroke can cause.</p>\r\n\r\n<p>By knowing the signs and symptoms of stroke, you can take quick action and perhaps save a life&mdash;maybe even your own.</p>\r\n\r\n<p><a href=\"https://www.cdc.gov/stroke/signs_symptoms.htm#\"><img alt=\"Signs of stroke in men and women.\" src=\"https://www.cdc.gov/stroke/images/Stroke-Signs-Men-Women-medium.jpg?_=77306\" title=\"Stroke-Signs-Men-Women\" /></a></p>\r\n\r\n<p>Call 9-1-1 immediately if any of these signs of stroke appear: Numbness or weakness in the face, arm, or leg; Confusion or trouble speaking or understanding speech; Trouble seeing in one or both eyes; Trouble walking, dizziness, or problems with balance; severe headache with no known cause.</p>\r\n\r\n<p><a href=\"https://www.cdc.gov/stroke/signs_symptoms.htm#\">View Larger</a></p>\r\n\r\n<h2>What are the signs of stroke in men and women?</h2>\r\n\r\n<ul>\r\n	<li>Sudden&nbsp;<strong>numbness</strong>&nbsp;or weakness in the face, arm, or leg, especially on one side of the body.</li>\r\n	<li>Sudden&nbsp;<strong>confusion</strong>, trouble speaking, or difficulty understanding speech.</li>\r\n	<li>Sudden&nbsp;<strong>trouble seeing</strong>&nbsp;in one or both eyes.</li>\r\n	<li>Sudden&nbsp;<strong>trouble walking</strong>, dizziness, loss of balance, or lack of coordination.</li>\r\n	<li>Sudden&nbsp;<strong>severe headache</strong>&nbsp;with no known cause.</li>\r\n</ul>\r\n\r\n<p><strong>Call 9-1-1 right away if you or someone else has any of these symptoms.</strong></p>\r\n\r\n<h2>Act F.A.S.T. to identify stroke</h2>\r\n\r\n<p>Act F.A.S.T. to help stroke patients get the&nbsp;<a href=\"https://www.cdc.gov/stroke/treatments.htm\">treatments</a>&nbsp;they need.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The&nbsp;<strong>stroke treatments that work best are available only if the stroke is recognized and diagnosed within 3 hours of the first symptoms</strong>. Stroke patients may not be eligible for these if they don&rsquo;t arrive at the hospital in time.</p>\r\n\r\n<p>If you think someone may be having a stroke, act F.A.S.T. and&nbsp;<strong>do the following test</strong>:</p>\r\n\r\n<p><strong>F&mdash;Face:</strong>&nbsp;Ask the person to smile. Does one side of the face droop?</p>\r\n\r\n<p><strong>A&mdash;Arms:</strong>&nbsp;Ask the person to raise both arms. Does one arm drift downward?</p>\r\n\r\n<p><strong>S&mdash;Speech:</strong>&nbsp;Ask the person to repeat a simple phrase. Is the speech slurred or strange?</p>\r\n\r\n<p><strong>T&mdash;Time:</strong>&nbsp;If you see any of these signs, call 9-1-1 right away.</p>\r\n\r\n<p><strong>Note the time when any symptoms first appear.</strong>&nbsp;This information helps health care providers determine the best treatment for each person.</p>\r\n\r\n<p><strong>Do not drive to the hospital or let someone else drive you.</strong>&nbsp;Call 9-1-1 for an ambulance so that medical personnel can begin life-saving treatment on the way to the emergency room.</p>\r\n\r\n<h2>What should I do to treat a transient ischemic attack (&ldquo;mini-stroke&rdquo;)?</h2>\r\n\r\n<p>If your stroke symptoms go away after a few minutes, you may have had a&nbsp;<a href=\"https://www.cdc.gov/stroke/about.htm#transient\">transient ischemic attack (TIA)</a>, also sometimes called a &ldquo;mini-stroke.&rdquo; Although brief, a TIA is a sign of a serious condition that will not go away without medical help.</p>\r\n\r\n<p>Unfortunately, because TIAs clear up, many people ignore them. But paying attention to a TIA can save your life. If you think you or someone you know has had a TIA, tell a health care team about the symptoms right away.</p>\r\n\r\n<h2>More information</h2>\r\n\r\n<h3>CDC</h3>\r\n\r\n<ul>\r\n	<li><a href=\"https://www.cdc.gov/bloodpressure/\">High Blood Pressure</a></li>\r\n	<li><a href=\"https://www.cdc.gov/heartdisease/men.htm\">Men and Heart Disease</a></li>\r\n	<li><a href=\"https://www.cdc.gov/salt/\">Salt</a></li>\r\n	<li><a href=\"https://www.cdc.gov/cholesterol/\">Cholesterol</a></li>\r\n</ul>\r\n\r\n<h3>Other Organizations</h3>\r\n\r\n<ul>\r\n	<li>American Stroke Association (ASA):&nbsp;<a href=\"https://www.stroke.org/en/about-stroke\">About Stroke</a>\r\n\r\n	<ul>\r\n		<li>ASA Resources in Spanish:&nbsp;<a href=\"https://www.stroke.org/en/about-stroke/recursos-en-espanol\">Recursos en Espa&ntilde;ol</a></li>\r\n	</ul>\r\n	</li>\r\n	<li>National, Heart, Lung, and Blood Institute:&nbsp;<a href=\"https://www.nhlbi.nih.gov/health-topics/stroke\">Stroke</a></li>\r\n	<li>National Institute of Neurological Disorders and Stroke (NINDS):&nbsp;<a href=\"https://www.ninds.nih.gov/Disorders/All-Disorders/Stroke-Information-Page\">Stroke Information Page</a>\r\n	<ul>\r\n		<li><a href=\"https://www.stroke.nih.gov/resources/\">NINDS Know Stroke Campaign</a></li>\r\n		<li><a href=\"https://www.stroke.nih.gov/materials/spanish-stroke-toolkit.htm\">NINDS Know Stroke Campaign Spanish Toolkit</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>',70,'stroke-signs-and-symptoms',1,'Aproved','thumbnail/default-thumbnail.png'),(5,'2023-03-11 08:59:31.553727','2023-03-24 03:19:46.602897','Content','Content','Content','Content','Content','Content','content','<p>diseases content</p>',2,'content',NULL,'Aproved','thumbnail/default-thumbnail.png'),(6,'2023-03-11 09:01:34.829919','2023-03-19 13:39:26.010403','lorem','lorem','lorem','lorem','lorem','lorem','lorem','<p>lorem</p>',0,'lorem',NULL,'Aproved','thumbnail/default-thumbnail.png'),(7,'2023-03-11 09:11:17.830521','2023-03-23 15:13:51.266726','kesel','kesel','kesel','kesel','kesel','kesel','kesel','<p>kesel</p>',2,'kesel',NULL,'Aproved','thumbnail/default-thumbnail.png'),(8,'2023-03-11 09:13:11.121072','2023-03-19 13:39:26.018307','wakatime','wakatime','wakatime','wakatime','wakatime','wakatime','wakatime','<p>wakatime</p>',0,'wakatime',17,'Aproved','thumbnail/default-thumbnail.png'),(9,'2023-03-11 09:15:54.005139','2023-03-24 03:27:56.859260','test','','','','','',NULL,'<p>test</p>',1,'test',17,'Aproved','thumbnail/default-thumbnail.png');
