INSERT INTO `disease_news` VALUES (2,'2023-01-29 02:59:47.922171','2023-03-23 15:21:23.245726','Heart Attack Symptoms, Risk, and Recovery','<h1>Heart Attack Symptoms, Risk, and Recovery</h1>\r\n\r\n<p><a href=\"https://www.cdc.gov/heartdisease/heart_attack.htm#print\" onclick=\"window.print()\">Print</a></p>\r\n\r\n<h2>What is a heart attack?</h2>\r\n\r\n<p><a href=\"https://www.cdc.gov/heartdisease/heart_attack.htm#\"><img alt=\"Heart attack signs and symptoms in women and men.\" src=\"https://www.cdc.gov/heartdisease/images/Heart-Attack-Signs-Men-Women-medium.jpg?_=75239\" title=\"\" /></a></p>\r\n\r\n<p>Heart attack signs and symptoms in men and women: Chest pain or discomfort; Shortness of breath; Pain or discomfort in the jaw, neck, back, arm, or shoulder; Feeling nauseous, light-headed, or unusually tired.</p>\r\n\r\n<p><a href=\"https://www.cdc.gov/heartdisease/heart_attack.htm#\">View Larger</a></p>\r\n\r\n<p>A heart attack, also called a myocardial infarction, happens when a part of the heart muscle doesn&rsquo;t get enough blood.</p>\r\n\r\n<p>The more time that passes without treatment to restore blood flow, the greater the damage to the heart muscle.</p>\r\n\r\n<p><a href=\"https://www.cdc.gov/heartdisease/coronary_ad.htm\">Coronary artery disease (CAD)</a>&nbsp;is the main cause of heart attack. A less common cause is a severe spasm, or sudden contraction, of a coronary artery that can stop blood flow to the heart muscle.</p>\r\n\r\n<h2>What are the symptoms of heart attack?</h2>\r\n\r\n<p>The major symptoms of a heart attack are</p>\r\n\r\n<ul>\r\n	<li><strong>Chest pain or discomfort.</strong>&nbsp;Most heart attacks involve discomfort in the center or left side of the chest that lasts for more than a few minutes or that goes away and comes back. The discomfort can feel like uncomfortable pressure, squeezing, fullness, or pain.</li>\r\n	<li><strong>Feeling weak, light-headed, or faint.</strong>&nbsp;You may also break out into a cold sweat.</li>\r\n	<li><strong>Pain or discomfort in the jaw, neck, or back.</strong></li>\r\n	<li><strong>Pain or discomfort in one or both arms or shoulders.</strong></li>\r\n	<li><strong>Shortness of breath.</strong>&nbsp;This often comes along with chest discomfort, but shortness of breath also can happen before chest discomfort.</li>\r\n</ul>\r\n\r\n<p>Other symptoms of a heart attack could include unusual or unexplained tiredness and nausea or vomiting. Women are more likely to have these other symptoms.&nbsp;<a href=\"https://www.cdc.gov/heartdisease/women.htm\">Learn more about women and heart disease</a>.</p>\r\n\r\n<p><strong>Every 40 seconds, someone in the United States has a heart attack.</strong>1&nbsp;<a href=\"https://www.cdc.gov/heartdisease/facts.htm\">Learn more facts about heart attack and heart disease.</a></p>\r\n\r\n<h2>Call 9-1-1 if you notice symptoms of a heart attack.</h2>\r\n\r\n<p>If you notice the symptoms of a heart attack in yourself or someone else,&nbsp;<strong>call 9-1-1 immediately</strong>. The sooner you get to an emergency room, the sooner you can get treatment to reduce the amount of damage to the heart muscle. At the hospital, health care professionals can run tests to find out if a heart attack is happening and decide the best treatment.</p>\r\n\r\n<p>In some cases, a heart attack requires cardiopulmonary resuscitation (CPR) or an electrical shock (defibrillation) to the heart to get the heart pumping again. Bystanders trained to use CPR or a defibrillator may be able to help until emergency medical personnel arrive.</p>\r\n\r\n<p>Remember, the chances of surviving a heart attack are better the sooner emergency treatment begins.</p>\r\n\r\n<h2>What are the risk factors for heart attack?</h2>\r\n\r\n<p>Several health conditions, your lifestyle, and your age and family history can increase your risk for heart disease and heart attack. These are called risk factors. About&nbsp;<strong>half of all Americans&nbsp;</strong>have at least one of the three key risk factors for heart disease: high blood pressure, high blood cholesterol, and smoking.2</p>\r\n\r\n<p>Some risk factors cannot be controlled, such as your age or family history. But you can take steps to lower your risk by changing the factors you&nbsp;<strong>can&nbsp;</strong>control.</p>\r\n\r\n<p>Learn more about&nbsp;<a href=\"https://www.cdc.gov/heartdisease/risk_factors.htm\">risk factors</a>&nbsp;for heart disease and heart attack.</p>\r\n\r\n<h2>What can I do to recover after a heart attack?</h2>\r\n\r\n<p><a href=\"https://www.qzzr.com/c/quiz/480768/cardiac-rehabilitation-and-your-heart\"><img alt=\"Cardiac Rehab Quiz\" src=\"https://www.cdc.gov/heartdisease/images/cardiac-rehab-quiz.jpg?_=91868\" title=\"cardiac-rehab-quiz\" /></a></p>\r\n\r\n<p>Take our&nbsp;<a href=\"https://www.qzzr.com/c/quiz/480768/cardiac-rehabilitation-and-your-heart\">quiz</a>&nbsp;to see how much you know about cardiac rehabilitation.</p>\r\n\r\n<p>If you&rsquo;ve had a heart attack, your heart may be damaged. This could affect your heart&rsquo;s rhythm and its ability to pump blood to the rest of the body. You may also be at risk for another heart attack or conditions such as&nbsp;<a href=\"https://www.cdc.gov/stroke/index.htm\">stroke</a>, kidney disorders, and&nbsp;peripheral arterial disease (PAD).</p>\r\n\r\n<p>You can lower your chances of having future health problems following a heart attack with these steps:</p>\r\n\r\n<ul>\r\n	<li><strong>Physical activity</strong>&mdash;Talk with your health care team about the things you do each day in your life and work. Your doctor may want you to limit work, travel, or sexual activity for some time after a heart attack.</li>\r\n	<li><strong>Lifestyle changes</strong>&mdash;Eating a healthier diet, increasing physical activity, quitting smoking, and managing stress&mdash;in addition to taking prescribed medicines&mdash;can help improve your heart health and quality of life. Ask your health care team about attending a program called cardiac rehabilitation to help you make these lifestyle changes.</li>\r\n	<li><strong>Cardiac rehabilitation</strong>&mdash;<a href=\"https://www.cdc.gov/heartdisease/cardiac_rehabilitation.htm\">Cardiac rehabilitation</a>&nbsp;is an important program for anyone recovering from a heart attack, heart failure, or other heart problem that required surgery or medical care. Cardiac rehab is a supervised program that includes\r\n	<ul>\r\n		<li>Physical activity</li>\r\n		<li>Education about healthy living, including healthy eating, taking medicine as prescribed, and ways to help you quit smoking</li>\r\n		<li>Counseling to find ways to relieve stress and improve mental health</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>A team of people may help you through cardiac rehab, including your health care team, exercise and nutrition specialists, physical therapists, and counselors or mental health professionals.</p>\r\n\r\n<p><a href=\"https://www.cdc.gov/heartdisease/images/HA-signs-symptoms-social1.png\" target=\"_blank\"><img alt=\"Every 40 seconds, someone in the United States has a heart attack. Learn prevention steps at cdc.gov/heartdisease.\" src=\"https://www.cdc.gov/heartdisease/images/HA-signs-symptoms-social1.png?_=39875\" title=\"\" /></a></p>\r\n\r\n<h2>More Information</h2>\r\n\r\n<ul>\r\n	<li>American Heart Association:&nbsp;<a href=\"http://www.heart.org/HEARTORG/Conditions/HeartAttack/Heart-Attack_UCM_001092_SubHomePage.jsp\">Heart Attack</a></li>\r\n	<li>National Heart, Lung, and Blood Institute:&nbsp;<a href=\"https://www.nhlbi.nih.gov/health-topics/heart-attack\">Heart Attack</a></li>\r\n</ul>\r\n\r\n<h2>References</h2>\r\n\r\n<ol>\r\n	<li>Tsao CW, Aday AW, Almarzooq ZI, Beaton AZ, Bittencourt MS, Boehme AK, et al.&nbsp;<a href=\"https://doi.org/10.1161/cir.0000000000001052\">Heart Disease and Stroke Statistics&mdash;2022 Update: A Report From the American Heart Association</a>.&nbsp;<em>Circulation.</em>&nbsp;2022;145(8):e153&ndash;e639.</li>\r\n	<li>Fryar CD, Chen T-C, Li X.&nbsp;<a href=\"https://www.cdc.gov/nchs/data/databriefs/db103.pdf\" target=\"_blank\">Prevalence of uncontrolled risk factors for cardiovascular disease: United States, 1999&ndash;2010&nbsp;[PDF-494K]</a>. NCHS data brief, no. 103. Hyattsville, MD: National Center for Health Statistics; 2012. Accessed May 9, 2019.</li>\r\n</ol>','heart-attack-symptoms-risk-and-recovery',1,NULL,18,'Aproved','thumbnail/default-thumbnail.png'),(4,'2023-02-25 14:17:39.061536','2023-03-23 15:13:36.711724','Testing Content vor admin','<p>tesaijdlkfj</p>','testing-content-vor-admin',NULL,NULL,7,'Aproved','thumbnail/default-thumbnail.png'),(6,'2023-02-25 14:18:40.478495','2023-03-22 15:09:32.319052','asdlkfaksjdf','<p>lkasjdf</p>','asdlkfaksjdf',NULL,NULL,0,'Aproved','thumbnail/default-thumbnail.png'),(7,'2023-02-25 14:18:54.737943','2023-03-22 15:09:32.323110','test test','<p>asdf</p>','test-test',NULL,NULL,0,'Aproved','thumbnail/default-thumbnail.png'),(9,'2023-03-11 08:46:15.935492','2023-03-22 15:09:32.328191','test','<p>test</p>','test',NULL,NULL,0,'Aproved','thumbnail/default-thumbnail.png');
